window.bookSummaryJSON = "<p><b>Maureen Doherty and her golden retriever, Finn, have taken possession of a charming old inn - only to discover that it's already possessed by tenants whose lease on life already ran out....</b></p> <p>Maureen's career as a sportswear buyer hits a snag just before Halloween, when the department store declares bankruptcy. Meanwhile, Finn's lost his way as a guide dog after flunking his test for being too friendly and easily distracted. Sadly, only one of them can earn unemployment, so Maureen's facing a winter of discontent in Boston - when she realizes she can't afford her apartment.</p> <p>Salvation comes when she receives a mysterious inheritance: an inn in Haven, Florida, a quaint, scenic town on the Gulf of Mexico hidden away from the theme parks. Maureen believes it's a good place to make a fresh start with a new business venture. But she gets more than she bargained for when she finds a dead body on her property - and meets some of the inn's everlasting tenants in the form of ghosts who offer their otherworldly talents in order to help her solve the mystery....</p>"; 
